import React, { useState, useEffect } from 'react';
import { View, Image, ImageBackground, Picker, StyleSheet, Text } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';

import styles from './estilo';
import styleGeral from '../../estiloGeral/style'

export default function tCadastrarInfoC() {

    const [nome, setnome] = useState("");//1
    const [sobrenome, setsobrenome] = useState("");//2
    const [data_de_nasc, setdata_de_nasc] = useState("");//3
    const [cpf, setcpf] = useState("");//4
    const [sexo, setsexo] = useState("");//5
    const [celular, setcelular] = useState("");//6
    const [email, setemail] = useState("");//7
    const [senha, setsenha] = useState("");//8
    const [preco, setpreco] = useState("");//9
    const [link, setlink] = useState("");//10

    const [dia, setdia] = useState("");
    const [mes, setmes] = useState("");
    const [ano, setano] = useState("");

    const navigation = useNavigation();
    
    const ComboDia = () => {
        const [selectedValue, setSelectedValue] = useState(1);
      
        const dias = Array.from({ length: 31 }, (_, i) => i + 1);
      
        const onValueChange = (itemValue) => {
          setSelectedValue(itemValue);
        };
    }

    function formatarData() {
        const dataFormatada = `${ano}-${mes}-${dia}T00:00:00`;
        setdata_de_nasc(dataFormatada);
    }

    function Voltar() {
        navigation.goBack()
    }

    return (
        <ImageBackground style={styleGeral.container}>
            <View style={styles.marginTop}>
                <Image style={{ width: 100, height: 109, marginTop: -30 }}
                    source={require('../../../assets/logo.png')} />
            </View>

            <View>
                <Text style={styles.title}>Cadastro Cuidador</Text>
            </View>

            <ScrollView>
                <View style={styles.footer}>
                    <TextInput
                        style={styles.input}
                        placeholder="Nome"
                        value={nome}
                        onChangeText={(texto) => setnome(texto)}
                        onPress={formatarData}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Sobrenome"
                        value={sobrenome}
                        onChangeText={(texto) => setsobrenome(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Sexo"
                        value={sexo}
                        onChangeText={(texto) => setsexo(texto)}
                    />

                    <View>
                        <TextInput
                            style={styles.input_nasc_dia}
                            placeholder="Dia"
                            value={dia}
                            onChangeText={(texto) => setdia(texto)}
                        />

                        <TextInput
                            style={styles.input_nasc_mes}
                            placeholder="M√™s"
                            value={mes}
                            onChangeText={(texto) => setmes(texto)}
                        />

                        <TextInput
                            style={styles.input_nasc_ano}
                            placeholder="Ano"
                            value={ano}
                            onChangeText={(texto) => setano(texto)}
                            onPress={formatarData}
                        />
                    </View>

                    <TextInput
                        style={styles.input}
                        placeholder="Celular"
                        value={celular}
                        onChangeText={(texto) => setcelular(texto)}
                        onPress={formatarData}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="CPF"
                        value={cpf}
                        onChangeText={(texto) => setcpf(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="E-mail"
                        value={email}
                        onChangeText={(texto) => setemail(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Senha"
                        value={senha}
                        onChangeText={(texto) => setsenha(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Pre√ßo"
                        value={preco}
                        onChangeText={(texto) => setpreco(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Link"
                        value={link}
                        onChangeText={(texto) => setlink(texto)}
                    />

                </View>
            </ScrollView>

            <View>
                <RectButton style={styles.buttonNext} onPress={() => navigation.navigate('tCadastroLocalC', {
                    nome: nome, sebrenome: sobrenome, celular: celular, cpf: cpf, email: email, senha: senha, preco: preco, link: link, sexo: sexo, data_de_nasc: data_de_nasc,
                })}>
                    <Text style={styles.buttonText}>Avan√ßar</Text>
                </RectButton>

                <RectButton style={styles.buttonReturn} onPress={Voltar}>
                    <Text style={styles.buttonText}>Voltar</Text>
                </RectButton>
            </View>
        </ImageBackground >
    );
}
